import React from 'react';
import { Container, Row, Col, Card, ListGroup, Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {
  const navigate = useNavigate();
  
  const sidebarItems = [
    'UI Elements',
    'Form elements',
    'Charts',
    'Tables',
    'Icons',
    'User Pages',
    'Error pages',
    'Documentation',
  ];

  const statCards = [
    {
      title: "epl",
      value: 4006,
      percent: '10.00%',
      days: '30 days',
      variant: 'primary',
      flag: 'https://flagcdn.com/w40/gb-eng.png',
      route: '/admin/epl'
    },
    {
      title: 'laliga',
      value: 61344,
      percent: '22.00%',
      days: '30 days',
      variant: 'dark',
      flag: 'https://flagcdn.com/w40/es.png',
      route: '/admin/laliga'
    },
    {
      title: 'others',
      value: 34040,
      percent: '2.00%',
      days: '30 days',
      variant: 'info',
      flag: 'https://flagcdn.com/w40/eu.png',
      route: '/admin/others'
    },
    {
      title: 'bundesliga',
      value: 47033,
      percent: '0.22%',
      days: '30 days',
      variant: 'danger',
      flag: 'https://flagcdn.com/w40/de.png',
      route: '/admin/bundesliga'
    },
    {
      title: 'league1',
      value: 47033,
      percent: '0.22%',
      days: '30 days',
      variant: 'warning',
      flag: 'https://flagcdn.com/w40/fr.png',
      route: '/admin/league1'
    },
    {
      title: 'seriaA',
      value: 47033,
      percent: '0.22%',
      days: '30 days',
      variant: 'success',
      flag: 'https://flagcdn.com/w40/it.png',
      route: '/admin/seriaa'
    },
  ];

  const handleCardClick = (route) => {
    navigate(route);
  };

  return (
    <Container fluid className="p-0" style={{ minHeight: '100vh', backgroundColor: '#f5f7fb' }}>
      <Row noGutters>
        {/* Sidebar */}
        <Col md={2} style={{ backgroundColor: '#4c3ecf', minHeight: '100vh', color: 'white' }}>
          <h5 className="p-3">Dashboard</h5>
          <ListGroup variant="flush">
            {sidebarItems.map((item, index) => (
              <ListGroup.Item
                key={index}
                style={{ backgroundColor: '#4c3ecf', color: 'white', cursor: 'pointer' }}
              >
                {item}
              </ListGroup.Item>
            ))}
          </ListGroup>
        </Col>

        {/* Main Content */}
        <Col md={10} className="p-4">
          {/* Header */}
          <Row className="mb-4 align-items-center justify-content-between">
            <Col>
              <h4>Welcome bro</h4>
              <p>
                All systems are running smoothly!{' '}
                <span className="text-primary"></span>
              </p>
            </Col>
            <Col md="auto">
              <Button variant="light">{new Date().toLocaleDateString()}</Button>
            </Col>
          </Row>

          {/* Weather & Image Section */}
          <Row className="mb-4">
            <Col md={6}>
              <Card className="p-4">
                <Card.Body className="d-flex align-items-center justify-content-between">
                  <div>
                    <h3>üå§Ô∏è 31¬∞C</h3>
                    <p className="mb-0">Chicago, Illinois</p>
                  </div>
                  <img
                    src="https://www.svgrepo.com/show/354141/family-trip.svg"
                    alt="family"
                    height="100"
                  />
                </Card.Body>
              </Card>
            </Col>
          </Row>

          {/* Stats Cards */}
          <Row>
            {statCards.map((card, index) => (
              <Col md={4} className="mb-4" key={index}>
                <Card 
                  bg={card.variant} 
                  text="white"
                  style={{ cursor: 'pointer', height: '100%' }}
                  onClick={() => handleCardClick(card.route)}
                >
                  <Card.Body className="d-flex align-items-center">
                    <div>
                      <Card.Title className="text-capitalize">{card.title}</Card.Title>
                      <h3>{card.value.toLocaleString()}</h3>
                      <small>{card.percent} ({card.days})</small>
                    </div>
                     <div className="mr-3">
                      <img 
                        src={card.flag} 
                        alt={`${card.title} flag`} 
                        style={{ width: '40px', height: '25px', objectFit: 'cover', borderRadius: '3px' }}
                      />
                    </div>
                  </Card.Body>
                </Card>
              </Col>
            ))}
          </Row>
        </Col>
      </Row>
    </Container>
  );
};

export default AdminDashboard;
